 fire engine is 90 km/h, express the speed in m/s.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"8ed0eaa7-1f34-4627-bccb-dc60001d3e22\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"00398040-efa4-47dd-980a-7189e4138660\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>2. How much time did the fire engine need to reach to the fire which was 8,200 meters away from the station?</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"5e741382-28d1-4815-8fd5-62f18bd96735\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Problem\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Problem\"},\"subContentId\":\"4eea3b88-56fb-46c0-ad84-c2721cb41927\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>1. \\\\(1 km/h\\\\) = \\\\(\\\\frac{1 km \\\\times 1000} {1 h \\\\times 3600}\\\\) = \\\\(\\\\frac {1000 m}{3600 s}\\\\) =&gt; <br />\\n\\\\(1 km/h\\\\) = \\\\(\\\\frac{1}{3.6}  m/s\\\\) </p>\\n\\n<p>Thus,</p>\\n\\n<p>\\\\(V=\\\\frac{90}{3.6}\\\\) = 25 m/s.</p>\\n\\n<p>2. \\\\( V=\\\\frac{d}{t}  \\\\) =&gt; \\\\( t=\\\\frac{d}{V}\\\\)=&gt; \\\\( t=\\\\frac{8,200}{25}  \\\\) = 328 seconds.</p>\\n\\n<p>So, the fire engine needed \\\\(\\\\frac{328}{60}\\\\) = 5.47 minutes to reach its destination.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untit \":[]},\"subContentId\":\"8f45bb12-1f6a-4394-b92b-775590ef04c7\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"f4a0326d-5274-4227-b50a-450dc51a087a\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Problem\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Problem\"},\"subContentId\":\"f59f2bb3-a3b0-4565-ae98-b8fac461c640\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>The vehicle that will arrive first is the one who took the least amount of time to arrive.</p>\\n\\n<p>The distance between the Vespa and the arrival line is \\\\( d=\\\\frac{130}{1000} \\\\) =  0.13 km</p>\\n\\n<p>\\\\( V(vespa)=\\\\frac{d(vespa)}{t(vespa)}  \\\\)</p>\\n\\n<p>\\\\( t(vespa)=\\\\frac{d(vespa)}{V(vespa)}  \\\\)</p>\\n\\n<p>\\\\( t=\\\\frac{0.13}{50}  \\\\) = 0.0026 hours</p>\\n\\n<p>The distance between the car and the arrival line \\\\( d=\\\\frac{205}{1000} \\\\) = 0.205 km</p>\\n\\n<p>\\\\( V(car)=\\\\frac{d(car)}{t(car)}  \\\\) =&gt; \\\\( t(car)=\\\\frac{0.205}{90}  \\\\) = 0.00227 hours</p>\\n\\n<p>\\\\(t_{car}\\\\) &lt; \\\\(t_{vespa}\\\\), which means that the car will arrive first.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"42bfb735-55e7-462c-a191-0ef0f103efee\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Answer\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Answer\"},\"subContentId\":\"bfc366da-502f-4f81-8f92-74a2ba4c3df8\"}],\"i10n\":{\"previousLab be traffic on some routes. The radars on the streets show the following average speeds. </p>\\n\\n<ul>\\n\\t<li>The upper route (99.9 km), no traffic, speed = 13 m/s</li>\\n\\t<li>The middle route (97.1 km), traffic, speed = 11.5 m/s</li>\\n\\t<li>The lower route (89.3 km), traffic, speed = 11 m/s</li>\\n</ul>\\n\\n<p>Specify the fastest route, taking the traffic into consideration.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"11e194ed-7fac-43b0-a6ce-15b368118c3c\"}],\"helpTextLabel\":\"roads\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Problem\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Problem\"},\"subContentId\":\"65e2d12f-a187-46ff-bba7-71e23035eae7\"},{\"params\":{\"helpTextLabel\":\"More information\",\"helpText\":\"\",\"elementList\":[{\"params\":{\"text\":\"<p>1. The average speeds of the upper, middle and the lower routes are:</p>\\n\\n<p>\\\\(V_{upper}\\\\) = \\\\(\\\\frac{99.9 \\\\times 1000}{2\\\\times60\\\\times60+22\\\\times60}\\\\)</p>\\n\\n<p>\\\\(V_{upper}\\\\) = \\\\(\\\\frac{99,900}{8,520} \\\\) = 11.72 m/s  </p>\\n\\n<p>\\\\(V_{middle}\\\\) = \\\\(\\\\frac{97,100}{7,560} \\\\) = 12.84 m/s</p>\\n\\n<p>\\\\(V_{lower}\\\\) = \\\\(\\\\frac{89,300}{6,780}\\\\) = 13.17 m/s</p>\\n\\n<p>2. The duration needed to reach the destination is the lowest.</p>\\n\\n<p>3. The durations of the upper, middle and the lower routes are:</p>\\n\\n<p>\\\\(t_{upper} = \\\\frac{99,900}{13}\\\\) = 7,684 seconds</p>\\n\\n<p>\\\\(t_{middle} = \\\\frac{97,100}{11.5}\\\\) = 8,443 s</p>\\n\\n<p>\\\\(t_{lower} = \\\\frac{89,300}{11} \\\\) = 8,118 s</p>\\n\\n<p>Thus, taking into consideration the traffic, the fastest route is the upper one.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"3b63fbf0-6ab6-4f75-8fa4-d2119ddbc2d0\"}]},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Answers\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Answers\"},\"subContentId\":\"ea11058b-ae72-4af8-acc0-0bbbdcee9a5f\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Documentation Tool\"},\"subContentId\":\"da61a751-d29e-4416-a489-26fe128304ee\"}},{\"content\":{\"params\":{\"text\":\"<h3><strong>Problem 4: The Type of Motion of a Car</strong></h3>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"220dd5dd-edcd-4094-98a4-5b606d8b050a\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"taskDescription\":\"Documentation tool\",\"pagesList\":[{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>To identify the type of motion of the car during initialization (I) and stop (S), its instantaneous speed was measured every 10 seconds. </p>\\n\\n<p>The table below represents the results. Referring to it answer the following questions.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"8649b189-ce92-49bd-9073-5f64cb874c59\"},{\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAA+UAAADtCAIAAABWGkMtAAAAAXNSR0ICQMB9xQAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsMAAA7DAcdvqGQAAAAZdEVYdFNvZnR3YXJlAE1pY3Jvc29mdCBPZmZpY2V/7TVxAAAbmElEQVR4Xu3dD1TV9f3HcYgE5g1QCvzTVHSCaJvgb8U07ShnuZlysuZPy3T9pKll8VtttrPZ6WytU555Tq1Oc2lK4S8tS39m7kfqjs4/wyZDmmCpiCagJcJNEBQEyt3f2/
